import { render } from '@testing-library/react';
import React from 'react';
import Items from './Items';
import ReactDOM from 'react-dom';

function Check(idl , quantity, amt){
  var i=0;

  function Out(){
    return (
      <div className="App">
      <h1>
       Billing
      </h1><br/>
      <form>
  <table class="table">
  
    <thead class="thead-dark">
      <tr>
        <th scope="col"></th>
        <th scope="col">Name</th>
        <th scope="col">Price</th>
        <th scope="col">quantity</th>
        <th scope="col">Amount</th>
  
      </tr>
    </thead>
    <tbody>
    {idl.map(function(iter){
    return (
      <tr>
      <td><img src={Items[iter].img}/></td>
      <td>{Items[iter].name}</td>
      <td>{Items[iter].price}</td>
      <td>{quantity[iter]}</td>
      <td>{Items[iter].price *quantity[iter] }</td>
      </tr>
    );
  })}
  </tbody>
      <tr>
        <th scope="col">Total</th>
        <th scope="col"></th>
        <th scope="col">{amt}</th>
        <th scope="col"></th>
        <th scope="col"><button class="btn btn-success" >Pay</button></th>
  
      </tr>
  
  </table>
  </form>
      </div>
    );
    }


  ReactDOM.render( <Out />, document.getElementById('root'));

}
  export default Check;
